import React from 'react';

const Home = () => {
  return (
    <h1>This is homepage</h1>
  );
}

const Service = () => {
  return (
    <h1>This is Service Page</h1>
  );
}

const About = () => {
  return (
    <h1>This is About Page</h1>
  );
}

const Contact = () => {
  return (
    <h1>This is Contact Page</h1>
  );
}

const App = () => {
  return (
    <>
      <Home />
      <Service />
      <About />
      <Contact />
    </>
  );
}

export default App;
